// import logo from './logo.svg';
import './App.css';
import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Channeling from './Component/Channeling/channeling';

function App() {
  return (
    <BrowserRouter>
      <div>
        <Switch>
          {/* Define your routes using Route components */}
          <Route path="/channeling" component={Channeling} />
        </Switch>
      </div>
    </BrowserRouter>
  );
}

export default App;
